        HttpClient client = _clientFactory.CreateClient();

        HttpResponseMessage res = await client.SendAsync(req);

        if (res.IsSuccessStatusCode)
        {
            _persona = await res.Content.ReadFromJsonAsync<Persona>();
        }

        isShowed = !isShowed;
    }

